import React from 'react'

export default function SearchResults(props) {
  const data = props.data;
  data = data.slice(5);
  return (
    <div>
        {data.map((data, index) => {
          return (
            <div className="results" key={index}>
              <ul key={index}>
                <li key={index}>{data.original_title}</li>
                <li key={index}>{data.vote_average}</li>
                <li key={index}>{data.release_date.slice(0, 4)}</li>
              </ul>
            </div>
          )
        })}
    </div>
  )
}
